import React from 'react'
import ReactMapGL from 'react-map-gl'
function Map() {
  let [viewport, setViewport] = useState({
    laititude: 37.7577,
    longitude: -122.4376,
    zoom: 0
  })
  return (
    <ReactMapGL {...viewport} onViewportChange={(newView) => setViewport(newView)}>

    </ReactMapGL>
  )
}

export default Map
